// Helper function untuk mencari siswa berdasarkan jurusan
export const getStudentsByJurusan = (jurusan: string) => {
  return allStudents.filter(s => s.jurusan === jurusan);
};

// Helper function untuk mencari siswa berdasarkan kelas
export const getStudentsByKelas = (kelas: string) => {
  return allStudents.filter(s => s.kelas === kelas);
};

// Helper function untuk mencari siswa berdasarkan tahun masuk
export const getStudentsByTahunMasuk = (tahun: number) => {
  return allStudents.filter(s => s.tahunMasuk === tahun);
};
